    const loadingStyle =  ({
    
      display: "block",
      marginLeft: "auto",
      marginRight: "auto",
      
    
  })
    return (

      
      <div>
          <img style={loadingStyle} src={loading} alt="loding" />
      </div>
    )
  }
}
